26 January 1999
Oh my goodness.
Though I was sicker than a proverbial dog, I lay in bed and visualized her winning. Over and over I visualized Amanda winning Miss Houston 1999.
I had called her at 3 and told her &ldquo;you can do it.&rdquo;
I had called her at 6 and left a message, &ldquo;you can do it.&rdquo;
The pageant started at 7pm, and I cried since I couldn&rsquo;t be there.
